import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Link } from 'react-router-dom';
import { Layout, Header, Navigation, Drawer, Content } from 'react-mdl';
import  Router from './components/Router';

function App() {
    const cart = [{ sku: 38094374, unitPrice: 24.0, name: "Red Shirt", quantity: 2 },
    { sku: 38094375, unitPrice: 24.0, name: "Blue Shirt", quantity: 1 },
    { sku: 38094321, unitPrice: 12.0, name: "Blue socks", quantity: 4 }]

    function Items(props) {
        return (
          <table>
            <tr>
                <th>Name</th>
                <th>Count</th>
                <th>Price</th>
                <th>Total</th>
              </tr>
            {props.values.map(item => (
              <tr>
                <td>{item.name}</td>
                <td>{item.count}</td>
                <td>${item.price}</td>
                <td>${item.price*item.count}</td>
              </tr>
            ))}
          </table>
        );
      }
  return (
    <div className="App">
     <div className="demo-big-content">
      <Layout>
          <Header title="Assemble Store" scroll>
              <Navigation>
                  <Link  to="/reviewCart">Cart</Link>
              </Navigation>
          </Header>
          <Drawer title="Assemble Store">
              <Navigation>
                  <Link  to="/reviewCart">Cart</Link>  
              </Navigation>
          </Drawer>
          <Content>
              <div className="page-content" />
              <Router/>
          </Content>
      </Layout>
    </div>
    </div>
  );
}

export default App;
